// src/components/About.js
import React from 'react';
import './About.css';

function About() {
  return (
    <section className="about-section">
      {/* SVG Wave Divider */}
      <div className="wave-divider">
        <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1440 320">
          <path fill="#000" fillOpacity="1" d="M0,224L48,192C96,160,192,96,288,96C384,96,480,160,576,181.3C672,203,768,181,864,170.7C960,160,1056,160,1152,160C1248,160,1344,160,1392,160L1440,160V320H0V224Z"></path>
        </svg>
      </div>
      
      <div className="about-content">
        <h2>About Us</h2>
        <p>
          UNSW PsychSoc is dedicated to creating a supportive and engaging environment for all UNSW Psychology students and enthusiasts.
        </p>
        <p>
          Our mission is to foster a sense of community, provide valuable resources, and support personal and professional growth among our members.
        </p>
      </div>
    </section>
  );
}

export default About;
